import React from 'react';
import "./deliveryCollection.css";

const DeliveryCollection = () => {
  return (
    <div className='delivery-collection'>
        <div className='max-width'>
            <div className='collection'></div>
        </div>
    </div>
  )
}

export default DeliveryCollection;
